import React from "react";
import Kick from "../components/Kick";

const OscControlsContainer = props => {
  return (
    <div className="card">
      <div className="column">
        Oscillator
        <Kick knobs="osc" kickPitchDecay={props.kickPitchDecay} />
      </div>
    </div>
  );
};

export default OscControlsContainer;
